INSERT INTO `empresa_migration` VALUES (1,21,171,'30712063412',NULL,NULL,NULL,'4R SOLUCIONES SRL',NULL,'4R SOLUCIONES',1,NULL,NULL,NULL,NULL,NULL,'\r\n  Con más de 8 años de experiencia como Partner Digital de Agencias y Empresas. \r\n  \r\n Miles de Proyectos Online Desarrollados para las marcas más importantes del mundo.\r\n...','www.4rsoluciones.com','342-4563950',NULL,'Salta 3116','-Santa Fe','4R SOLUCIONES S.R.L. 4R SOLUCIONES'),(2,21,227,'30676889376',NULL,NULL,NULL,'A S A  SRL',NULL,'ASA',1,NULL,'2130',NULL,NULL,NULL,'\n	Desde el momento que Ud. compra un Producto ASA, respondemos al compromiso de brindarle el mayor respaldo y el mejor servicio de post-venta.\n\n	Nuestra Empresa nace en el año 1994 en la ciudad de Rosario, comenzando a operar como una empresa dedicada a brindar ASISTENCIA y SUMINISTROS de componentes a los primeros centros de distribución que se construyeron en Argentina.\n\n	En el inicio del año 2004, A.S.A SRL incorpora nuevas tecnologías para abastecer las necesidades que exige el mercado logístico.\n\n	Con estas incorporaciones traslada sus instalaciones al PARQUE INDUSTRIAL ALVEAR, donde se encuentra actualmente y elabora todos sus productos.\n\n	Instalaciones de 3.000 m2 en un terreno de 10.000 m2 de superficie que incorpora cabina de pintura, 2 puentes grúa de capacidad 2 t, equipos de última tecnología, stock permanente de repuestos, servicio técnico, oficinas con atención telefónica y comunicación a través de Int...','http://www.asasrl.com.ar','+54 (341) 5181122   ',NULL,'RUTA 21KM 286 LOTE 6 0','Rosario-Alvear','A.S.A. SRL ASA'),(3,21,56,'33500705529',NULL,NULL,NULL,'ANGEL Y FRANCISCO FONTANET S R L',NULL,'CALDERAS FONTANET',1,NULL,'2300',NULL,NULL,NULL,'\r\n  Calderas Fontanet una empresa dedicada, al diseño, fabricación y venta de generadores de vapor y de agua caliente, tanques, equipos especiales y trabajos en calderería según planos.\r\n\r\n  Con más de 90 años de trayectoria en la generación de energía, entregamos día a día to