onal altamente calificado lo que asegura una producción de calidad con los más altos estándares del mercado.\r\n\r\n	Diseño e innovación son sus máximos pilares junto con la experiencia y la responsabilidad en la entrega hacen de Aberturas Inducor la opción más inteligente a la hora de decidirse por productos de máxima satisfacción.\r\n\r\n	Aberturas Inducor se distingue por la mejor relación precio-calidad.\r\n\r\n	Cuenta con una planta industrial modelo, maquinarias con tecnología de punta, stock permanente y servicio de entrega para satisfacer con eficacia y rapidez al mercado más exigente.\r\n...','www.aberturasinducor.com.ar','341-4580134',NULL,'Juan Jose Paso 7122','Rosario-Rosario','ABERTURAS INDUCOR de Gonano Ernesto ABERTURAS INDUCOR'),(10,21,103,'30502874353',NULL,NULL,NULL,'ACEITERA GENERAL DEHEZA S A',NULL,'AGD',1,NULL,'263002',NULL,NULL,NULL,'\r\n  Aceitera General Deheza (AGD) es una empresa netamente argentina, de capitales privados que apuesta, con fuerte convicción, al desarrollo y la producción dentro del sector agroindustrial para abastecer una demanda global creciente y proyectarse al futuro. En este sentido, articula todas las etapas del proceso, desde el cultivo y la molienda de oleaginosas hasta el envasado de productos bajo normas de calidad ISO 9001. Se trata de una empresa sólidamente integrada y con un perfil tecnológico de alta competitividad en el dinámico escenario de los agro-negocios, exhibiendo un posicionamiento único por sus niveles de integración, diversificación y tecnología.\r\n...','www.agd.com.ar','03465-425097',NULL,'RUTA 33, EX FARRE','General López-Firmat','ACEITERA GENERAL DEHEZA S A AGD'),(11,21,241,'30567198088',NULL,NULL,NULL,'ACERGOM S A',NULL,'ACERGOM S.A.',1,NULL,'2000',NULL,NULL,NULL,'',NULL,'341-4583311',NULL,'Provincias Unidas 1050 “Bis”','Rosario-Rosario','ACERGOM S.A. '),(12,21,5,'30564784806',NULL,NULL,NULL,'ACERIAS 4 C SOCIEDAD ANONIMA',NULL,'ACERIAS 4C',1,NULL,'2505',NULL,NULL,NULL,'\r\n ACERIAS 4C S.A. es una moderna Empresa dedicada a la fundición de aceros al carbono, aceros de baja aleación y nodular, para proveer componentes a las fábricas de válvulas industriales, maquinarias agrícolas, transporte ferroviario, vial, matrices, repuestos industriales, máquinas y equipos, etc.\r\n\r\n  Cuenta con una planta industrial adecuada en su tecnología y capacidad técnica para asegurar a sus clientes productos con alto grado de calidad y confiabilidad, respondiendo de esta manera con las exigencias de un mercado que cada día se torna más competitivo.\r\n\r\n Situada en Las Parejas, pujante ciudad de la Pcia. de Santa Fe, hoy puede mostrar orgullosa los logros obtenidos con el esfuerzo mancomunado de todos sus colaboradores.\r\n...','http://www.acerias4c.com.ar/','3471-472000',NULL,'Juan Perón Nro 465 ','Belgrano-Las Parejas','ACERIAS 4C S.A. ACERIAS 4C'),(13,21,171,'30708282207',NULL,NULL,NULL,'INOXIDABLE PUNTO COM S A',NULL,'Acerind',1,NULL,'3000',NULL,NULL,NULL,'\r\n  \r\n    Quienes Somos\r\n\r\n\r\n  Establecida en el mercado desde 1982, con el objetivo de servir a las necesidades de la industria alimentaria en general, suministrando una variada gama de accesorios, como así también todos los elementos necesarios para la construcción y montaje de equipos industriales en acero inoxidable.\r\n\r\n Acerind cuenta con una Planta de Producción de 1500 m2 ubicada en Recreo Sur, equipada con la más moderna tecnología para la fabricación de accesorios con calidad internacional. Su personal técnico está capacitado para desarrollar y elaborar una variada gama de elementos standard y a pedido.\r\n\r\n PRODUCTOS\r\n  Accesorios (Válvulas accionadas y manuales, codos, tes, uniones, reducciones, etc.)\r\n  Chapas, barras, planchuelas, tubos, perfiles, alambres, electrodos, alambres para soldadura.\r\n\r\n APLICACION\r\n Construcción y montaje de equipos de acero inoxidable para Industria Alimentaria, Vitivinícola, Frigor...','http://acerind.com/web/','342-4692020',NULL,'Manuel Alberti 2528','La Capital-Santa Fe','ACERIND SC de Nappa Egidio y Adrián Acerind'),(14,21,3,'30707099344',NULL,NULL,NULL,'ACHILLI Y DI BATTISTA S.R.L.',NULL,'ACHILLI Y DI BATTISTA',1,NULL,'250801',NULL,NULL,NULL,'\n	Achilli y Di Battista es una empresa de gente joven, integrada en un ambiente calido y familiar.\n\n	Cuenta con una reconocida trayectoria de trabajo y honestidad en la industria argentina de maquinaria agrícola.\n\n	Por estos valores y por la relación de amistad con nuestros clientes podemos hoy sentirnos orgullosos de nuestra empresa y nuestros productos que paso a paso van sembrando el suelo y el futuro de nuestro país.\n\n	En estos momentos la empresa está abocada a explorar nuevos caminos en el mercado externo. Es por ello que estamos certificando normas de calidad, requisito indispensable para lograr esos objetivos.\n\n	Hemos participado en Misiones comerciales a Filipinas, Ecuador, Colombia, México, Perú, Bolivia donde dejamos bien claro nuestro objetivo, de brindar, además de un buen producto, un buen asesoramiento de la mano del INTA. quien nos acompaña a todos lados como una carta de presentación.\n\n	En cuando a lo edilicio contamos con una...','www.admonumental.com.ar','3471-461321',NULL,'SANGUINETTI 1111','Belgrano-Armstrong','ACHILLI Y DI BATTISTA S.R.L. ACHILLI Y DI BATTISTA'),(15,21,85,'30501199253',NULL,NULL,NULL,'ACINDAR INDUSTRIA ARGENTINA DE ACEROS S A',NULL,'ACINDAR INDUST. ARG.DE ACEROS S.A.',1,NULL,'291902',NULL,NULL,NULL,'','www.acindar.com.ar','3400-478200',NULL,'RUTA 21 KM 247','Constitución-Villa Constitucion','ACINDAR INDUST. ARG.DE ACEROS S.A. '),(16,21,227,'30701508293',NULL,NULL,NULL,'ACM ARGENTINA SRL',NULL,'ACM',1,NULL,'2126',NULL,NULL,NULL,'',NULL,'341-4929395                        ',NULL,'LOTE 104 PARQUE INDUSTRIAL','Rosario-Alvear','ACM ARGENTINA S.R.L. ACM'),(17,21,297,'30708269278',NULL,NULL,NULL,'ACRILPAL S.A.',NULL,'ACRILPAL',1,NULL,'2252',NULL,NULL,NULL,'\r\n AcrilPal S.A. desde junio de 1979 juega el juego que m{as le gusta: crear. Con planta fabril en la ciudad de Gálvez - centro de la pronvincia de Santa Fe - su fundador, el señor Ruben Eduardo Pala. ejerce la dirección de producción, comercialización y servicios con un notable \"know how\" de mercado que tiene como corelato el liderazgo de Acrilpal S.A. en materia de juego desde hace más de dos décadas. Su dedicación, responsabilidad y capacidad para interpretar los requerimientos de cada cliente, han sido y son bases fundamentales de un crecimiento sostenido. Si a ello se agrega la alta tecnología empleada y los rigurosos controles a los que se somete cada unidad de producción, se comprobará que no es \"por azar\" que Acrilpal S.A., desde hace 20 años, gane en calidad.\r\n...','www.acrilpal.com.ar','3404-481920',NULL,'PRIMERA JUNTA 882','San Jerónimo-Gálvez','ACRILPAL S.A. ACRILPAL'),(18,21,180,'20171610800',NULL,NULL,NULL,'ADRIAN ANTONIO DARRAS',NULL,'Válvulas León ',1,NULL,'3080',NULL,NULL,NULL,'\r\n  La empresa Válvulas León fabrica productos de calidad desde hace más de 30 años en Esperanza, Santa Fe, Argentina\r\n...','http://www.valvulasleon.com.ar/','3496-427103',NULL,'Padre Kredder 3820','Las Colonias-Esperanza',' Adrian Antonio Darras Válvulas León '),(19,21,95,'30687234991',NULL,NULL,NULL,'ADVANTA SEMILLAS S A I C',NULL,'ADVANTA SEMILLAS S A I C',1,NULL,'2618',NULL,NULL,NULL,'\r\n	Advanta es una empresa global de semillas que aplica las más avanzadas técnicas de mejoramiento vegetal convencional y biotecnología agrícola a una amplia base de germoplasma propio para obtener híbridos de alta calidad, ofreciendo semillas con los más rigurosos estándares y soluciones para productores en distintas partes del mundo.\r\n\r\n	Advanta Semillas se constituye en Argentina como tal en 1996, a partir de la fusión de dos importantes programas de investigación en Sorgo y Girasol, los cuales cuentan en la actulidad con más de 40 años de actividad ininterrumpida en el desarrollo de la excelencia genética en semillas.\r\n\r\n	En 2006 Advanta fue adquirida por el Grupo UPL, la empresa de producción de productos de protección de cultivos más grande de India y la quinta en el mundo.\r\n\r\n	Desde ese año a la actualidad, Advanta ha crecido en sus operaciones comerciales y en sus portfolio de germoplasm...',NULL,NULL,NULL,'RUTA NACIONAL 33 - K 0','-CARMEN','ADVANTA SEMILLAS S A I C '),(20,21,3,'30707895825',NULL,NULL,NULL,'AGLOBAL SRL',NULL,'SR Indumentaria de Trabajo',1,NULL,'2508',NULL,NULL,NULL,'\r\n  Es una empresa familiar de la Localidad de Armstrong Provincia de Santa Fe con más de 25 años de trayectoria. Con gran capacidad de trabajo, interpretación de las necesidades del mercado y visión de las tendencias tecnológicas en materia de ropa de trabajo, se fue afianzando y posicionando un mercado exigente y competitivo.\r\n\r\n EQUIPO DE PROTECCIÓN INDIVIDUAL (EPI)\r\n\r\n Producto desarrollado bajo estrictas normativas de los Organismos Oficiales y aceptado por la Administración De Riesgo de Trabajo. (ART). Este equipo ha sido especialmente diseñado para la máxima protección del personal que efectúa tareas de fumigación y manipuleo de químicos que involucran un alto riesgo de contaminación. El secreto: está en el proceso de la tela utilizada para su confección, que permite seguridad, confort  y una inmejorable ventilación, aún en las condiciones más adversas de trabajo...','www.confeccionessr.com.ar','3471-461324',NULL,'Castellano 925','Belgrano-Armstrong','AGLOBAL S.R.L. SR Indumentaria de Trabajo'),(21,21,293,'30663222852',NULL,NULL,NULL,'AGRANA FRUIT ARGENTINA S.A.',NULL,'AGRANA',1,NULL,'2240',NULL,NULL,NULL,'\n AGRANA Fruit es el líder mundial del mercado en la producción de preparados de fruta.\n\n Nuestros preparados de fruta son productos especiales hechos a medida de los requerimientos de cada aplicación, y son el resultado de una cuidadosa investigación  y de un alto grado de cooperación con nuestros clientes en su desarrollo.\n\n  Como líder del mercado de preparados de fruta, AGRANA, además de abastecer a la industria láctea, también brinda sus productos a las industrias de panificados, golosinas y helados.\n\n  Nuestras plantas de producción están ubicadas en la proximidad de las de nuestros clientes, para poder asegurar la máxima frescura y calidad. Nos abastecemos de materias primas globalmente, mientras que las frutas congeladas son procesadas a nivel local.\n\n AGRANA Fruit Argentina S.A. opera su planta de producción de preparados de fruta en Coronda, Provincia de Santa Fe, un lugar estratégicamente ubic...','www.agrana.com.ar','0342 4910275',NULL,'BELGRANO 2899','San Jerónimo-Coronda','AGRANA FRUIT ARGENTINA S.A AGRANA'),(22,21,112,'20061449923',NULL,NULL,NULL,'ROBERTO MARTIN AGRASO',NULL,'Agraso Maderas',1,NULL,'6100',NULL,NULL,NULL,'\r\n Desde hace 35 años nos dedicamos a la fabricación y distribución de soluciones funcionales, rusticas y seguras para el manejo de ganadería.\r\n\r\n  Fabricamos todo tipo de artículos en maderas duras tranqueras, cargadores, mangas, toril, casilla de parto, casilla de operar proveemos directo de origen postes de quebracho, itin, palo santo varillas, todo para corrales, alambrados y más.\r\n\r\n Fabricamos, distribuimos e instalamos DESDE RUFINO A TODO EL PAÍS.\r\n...',NULL,'(03382) 420920',NULL,'America 64 Bis','General López-Rufino','AGRASO ROBERTO MARTIN Agraso Maderas'),(23,21,241,'30525718626',NULL,NULL,NULL,'AGRICULTORES FEDERADOS ARGENTINOS SOC COOP LTDA',NULL,'AGRICULTORES FEDERADOS ARGENTINOS',1,NULL,'2000',NULL,NULL,NULL,'\r\n Agricultores Federados Argentinos S.C.L. es la principal Cooperativa Agropecuaria de primer grado en Argentina y una de las más grandes y pujantes de América Latina.\r\n\r\n Los 36.000 Productores Asociados cuentan con una estructura compuesta por más de 1.600 empleados permanentes en 26 Centros Cooperativos Primarios, que sumados a los Sub-Centros, Oficinas y Representaciones permiten que la entidad tenga presencia arraigada en 130 localidades de 9 provincias Argentinas: S