ghes','ALBERTO L. MARCHIONNI S.A. ALBERTO L. MARCHIONNI'),(46,21,5,'20061778048',NULL,NULL,NULL,'ALBERTO MIGUEL ANGEL PAGOTTI',NULL,'Alberto Pagotti Maquinarias',1,NULL,'2505',NULL,NULL,NULL,'\r\n  Alberto Pagotti maquinarias es una empresa líder en la fabricación de máquinas agrícolas, la cual se distingue por su alta calidad, buenos precios  y el compromiso en cada detalle. Cuenta con personal de servicio técnico altamente especializado y una amplia red de concesionarios.\r\n\r\n  La empresa Alberto Pagotti Maquinarias inicio sus actividades a comienzo del 2002, donde ya contaba con más de tres décadas de experiencia en la fabricación de maquinas agrícolas.\r\n\r\n Entre sus productos podemos destacar la fabricación de Inoculadores de Semillas, Silos aéreos de 35º, 45º, 60º, como también fijos, Elevadores de granos, Limpiadoras de cereales 20 Tn/h, 40 Tn/h, 80 Tn/h, Fertilizadoras Bidisco de 1000Lts, 3000Lts, Tolvas Semilleras de 10 Tn y 12 Tn, Acoplados Tanques Combinados, Acoplado Playos, Mezcladoras de tipo Minimixer, entre otros trabajos especiales. \r\n\r\n   \r\n...','www.pagotti.com.ar','3471 - 470700',NULL,'Calle 25 Nro. 1150-1152','Belgrano-Las Parejas','Alberto Pagotti Alberto Pagotti Maquinarias'),(47,NULL,139,'30709000433',NULL,NULL,NULL,'ALBERTO PRIETO S.A.',NULL,'ALBERTO PRIETO S.A.',0,NULL,'3560',NULL,NULL,NULL,'\r\n  Entre 1885 y 1890, José Prieto Lagos, trabajador molinero proveniente de la ciudad de Oviedo, región de Asturia España, desembarca en tierras Argentinas junto a su esposa Eugenia Montequin.\r\n\r\n En 1914 compra un molino con rolos de piedra a la familia Buyatti y comienza a fabricar harina de maíz.\r\n\r\n En el año 1917 la usina de Reconquista deja de funcionar, y es aquí cuando José Prieto Lagos, para poder seguir trabajando compra un motor Otto-Deutz de 16 HP en Alemania. Esto fue todo un acontecimiento para la ciudad debido a que fue el segundo motor de esas características que llegó a la zona.\r\n\r\n Los primeros clientes eran agricultores que traían su cereal para ser molido, (cumpliendo el doble rol de proveedor-cliente) y se llevaban parte de la harina fabricada.\r\n\r\n  En la actualidad la empresa que preside Fabian A. Prieto se encuentra situada en el Parque Industrial de la ciudad de Reconquista y se dedica a la elaboración y ...','http://www.albertoprietosa.com.ar','3482-426500',NULL,'LOTE 44 PARQUE INDUSTRIAL','General Obligado-Reconquista','ALBERTO PRIETO S.A. ALBERTO PRIETO S.A.'),(48,21,103,'30708385154',NULL,NULL,NULL,'NYSA SOCIEDAD ANONIMA',NULL,'ALCAL ',1,NULL,'2630',NULL,NULL,NULL,'\n	ALCAL es una empresa con más de 40 anos de trayectoria en la fabricación de implementos para la agricultura y la ganadería.\n	Nuestra producción abarca las siguientes líneas: Forraje: Moledoras de Rollos y de Granos, Moledoras de Fardos, Moledoras de Granos , Elevadores de Granos y Quebradoras de Granos. Almacenamiento: Silos aéreos y silos de base fija, en variados diámetros y alturas. Cosecha: Barras de corte flexibles y flotantes, cabezales sojeros, girasoleros y legumbreros. \n	Todos los productos son elaborados bajo estrictas normas de calidad y cuentan con un diseno garantizado por nuestra amplia experiencia en el rubro\n...','www.alcal.com.ar','3465-424729',NULL,'25 de Mayo 1702','General López-Firmat','NYSA S.A. ALCAL '),(49,21,241,'30710549709',NULL,NULL,NULL,'ITALGOM ELASTOMEROS S.A.',NULL,'ITALGOM',1,NULL,'2000',NULL,NULL,NULL,'\r\n  ITALGOM, empresa dedicada a la manufactura integral del caucho. La satisfacción puntual de cada cliente, el cumplimiento de estándares internacionales de calidad y el desarrollo de procesos y productos no agresivos para el medio ambiente son, hoy, las herramientas con las que ITALGOM se propone alcanzar las metas de una industria creciente y poderosa. Nuestro lema; crecemos por nosotros y para nuestros clientes.\r\n...','www.italgom.com.ar','+54 0341 5680341',NULL,'Italia 4573A','Rosario-Rosario','ITALGOM ELASTOMEROS S.A. ITALGOM'),(50,NULL,241,'201252