rra Mundial.\r\n\r\n  A partir de ese momento, se incrementa y desarrolla la producción, incorporándose constantemente nuevos avances tecnológicos. El crecimiento de la empresa, determinó que el proceso de fabricación de rodamientos se ampliara, para satisfacer las necesidades del mercado local y de exportación, tanto en las series milimétricas como de pulgadas.\r\n\r\n  La línea de producción de la Empresa, incluye la fabricación de rodamientos de rodillos cónicos y cilíndricos, rodamientos...','www.marietta.com.ar','341-4622244',NULL,'AV. OVIDIO LAGOS 455','Rosario-Rosario','ALFREDO MARIETTA-MARMETAL S.A.I.C. MARMETAL'),(54,21,123,'30595124049',NULL,NULL,NULL,'ALGODONERA AVELLANEDA SOCIEDAD ANONIMA',NULL,'ALGODONERA AVELLANEDA',1,NULL,'356101',NULL,NULL,NULL,'\r\n Algodonera Avellaneda S.A., a través del desarrollo de sus actividades integra verticalmente la totalidad del proceso algodonero: acopio, desmotado; hilado y tejido; confección de prendas de vestir y fabricación de algodón hidrófilo, productos derivados y específicos. El proceso industrial de esta oleaginosa comienza en cuatro plantas desmotadoras de algodón localizadas en centros neurálgicos en las provincias de Chaco, Formosa y Santiago del Estero. \r\n La empresa posee dos Hilanderías localizadas en Argentina y Brasil, que cuentan con los máximos niveles de tecnología aplicada en la hilatura convencional y open end. Cuenta con una moderna planta productora de algodón hidrófilo y productos específicos, equipamiento de última generación, siendo uno de los de mayor producción del mundo. El especial interés que la empresa y su personal tienen por el cuidado ambiental se apreci...','http://www.vicentin.com.ar','3482-481149                       ',NULL,'AV.SAN MARTIN S/N','General Obligado-Avellaneda','ALGODONERA AVELLANEDA S.A. ALGODONERA AVELLANEDA'),(55,21,119,'30612558589',NULL,NULL,NULL,'PROVIMI ARGENTINA S.A.',NULL,'PROVIMI',1,NULL,'2600',NULL,NULL,NULL,'\r\n Con más de 100 plantas en 30 países, es el