ani Hnos SRL es una empresa santafesina que elabora fármacos y biológicos veterinarios con más de 25 años de experiencia en el mercado argentino. \r\n \r\n  El laboratorio en sus comienzos fue creado por Edgardo Segismundo Allignani, farmacéutico y mentor de este sueño que con el paso de los años fue ganándose su propio mercado y prestigio en la medicina veterinaria gracias a la calidad de los productos que él mismo elaboraba, rotulaba y vendía. Por el año 1982 asumen en la empresa la segunda generación creando así Allignani Hnos SRL y afianzándose aún más, no solo en todo el territorio nacional, sino también en el mercado internacional.\r\n\r\n  Poco a poco la empresa comenzó a expandirse, no solo en su propia línea de productos, sino también importando calidad internacional. De esta forma comienzan los vínculos comerciales con el laboratorio Alfasan de ...','www.allignanihnos.com.ar','342-4538777',NULL,'BALCARCE 951','La Capital-Santa Fe','ALLIGNANI HNOS S.R.L. ALLIGNANI'),(58,21,245,'30504954109',NULL,NULL,NULL,'ALLOCCO SA',NULL,'ALLOCCO',1,NULL,'2124',NULL,NULL,NULL,'\r\n  Con más de 50 años de historia, ALLOCCO™ ocupa una posición de liderazgo en desarrollos de ingeniería destinados a empresas que producen aceites, proteínas y biocombustibles.\r\n\r\n  Los equipos ALLOCCO™ representan una producción de alta calidad y soluciones adaptadas a sus clientes en un sector clave de la actividad agroindustrial.\r\n\r\n  MAPCA S.A. adquirió los derechos de ALLOCCO™, con la decisión de reposicionarla en lo más alto del mercado.\r\n\r\n Profesionalismo y un ambicioso programa de inversiones son las principales herramientas con las que contamos para el logro de nuestros objetivos.\r\n\r\n  Una sólida presencia en la región, el respeto alcanzado por la marca ALLOCCO™ en tan exigente mercado y la confiabilidad de nuestras respuestas, nos posiciona ante los ojos de los más importantes clientes del sector.\r\n...','www.allocco.com.ar','341-4921911',NULL,'AV.FILIPPINI 1342','Ros