s estándares de calidad de las normas ASTM y UNE, además de ser sometidos a un estricto control de inspecciones permanentes que se realizan sobre los stocks fabricados por personal propio y externo.\r\n\r\n Nos aprovisionamos de materia prima exclusivamente con los líderes del mercado. Desarrollamos la ingeniería de producto con profesionales de experiencia en el sector.\r\n...','http://www.conquestsa.com.ar/','341-4921477',NULL,'Saenz Peña 1695','Rosario-Villa Gobernador Galvez','CONQUEST S.A. CONQUEST'),(247,21,169,'30708263679',NULL,NULL,NULL,'CONSTRUCCIONES INDUSTRIALIZADAS S.R.L.',NULL,'FIMER',1,NULL,'3018',NULL,NULL,NULL,'\r\n Somos una empresa especializada en construcción y remodelación de Cámaras frigoríficas, Plantas para la industria alimenticia y centros de logística\r\n\r\n  Hemos desarrollado a través de nuestra historia empresarial un novedoso sistema constructivo industrializado basado en la utilización de una amplia gama de paneles térmicos que cumple con los requerimientos sanitarios, térmicos y de celeridad ejecutiva, exigido en todo proyecto de obra.\r\n\r\n  En nuestra “Planta Industrial Recreo Sur” fabricamos paneles inyectados en poliuretano, puertas frigoríficas y disponemos de todos los componentes utilizados en los sistemas industrializados de construcción.\r\n...','www.fimer.com.ar','342-4905674',NULL,'Ruta Nac. 11 Km. 477','La Capital-Recreo','CONSTRUCCIONES INDUSTRIALIZADAS S.R.L. FIMER'),(248,21,241,'30707644024',NULL,NULL,NULL,'CONVERGENCE LATINOAMERICANA S.A.',NULL,'ABON GARDEN',1,NULL,'2000',NULL,NULL,NULL,'','www.abongarden.com','341-4850340',NULL,'SARMIENTO 2230','Rosario-Rosario','CONVERGENCE LATINOAMERICANA S.A. ABON GARDEN'),(249,21,119,'30511997557',NULL,NULL,NULL,'COOP LTDA DE INSEMINACION ARTIFICIAL DE VENADO TUERTO (CIAVT)',NULL,'CIAVT',1,NULL,'2600',NULL,NULL,NULL,'\r\n CIAVT es una empresa cooperativa con 50 años de trayectoria en el negocio de la genética bovina. Desde el corazón de la pampa húmeda argentina, una región de notable riqueza agropecuaria, CIAVT ofrece a todo el país una completa selección de toros probados y jóvenes de razas lecheras y carniceras.\r\n\r\n La casa central, en la ciudad de Venado Tuerto (Santa Fe), cuenta con un centro de producción de semen con instalaciones para el alojamiento de más de 120 toros residentes, lazareto cuarentenario, laboratorio central, sala de capacitación, oficinas administrativas y 50 hectáreas de campo para la producción del alimento de los toros.\r\n\r\n  Desde allí y a través de una importante red comercial propia y de una cadena de distribuidores veterinarios, CIAVT abastece a socios y clientes ubicados en diferentes puntos estratégicos del país.\r\n...','http://www.ciavt.com.ar','3462-435153',NULL,'RUTA NAC N 33 KM 636 0','General López-Venado Tuerto','COOP LTDA DE INSEMINACION ARTIFICIAL DE VENADO TUERTO CIAVT'),(250,21,126,'30530920697',NULL,NULL,NULL,'COOPERATIVA AGROPECUARIA DE MALABRIGO LIMITADA',NULL,'COOPERATIVA AGROPECUARIA DE MALABRIGO LIMITADA',1,NULL,'3572',NULL,NULL,NULL,'\r\n	Un puñado de hombres sin mayores conocimientos teóricos acerca de la empresa que iniciaban, pero animados por una férrea voluntad de servir a sus hermanos de tarea, se reunieron en el salón del teatro español, hoy sede del Club Atlético Juventud y dejaron constituida la Cooperativa Agropecuaria de Colonia Ella, hoy Cooperativa Agropecuaria de Malabrigo Limitada.\r\n\r\n	Eran tiempos en los que había que superar la incertidumbre y el riesgo propio de todo nuevo emprendimiento, había que superar la resistencia de los grupos que veían afectados sus intereses, como así también había que superar el descreimiento y la desconfianza, tal vez producto del intento fallido de la década anterior, de la cooperativa fundad en 1931., y que termino con su disolución, pocos años después.\r\n\r\n	Lotes de Lino del año 1947, -principal cultivo de la zona por esos años- fueron los que iniciaron a la Cooper...',NULL,'3482-454025',NULL,'Espontón 999','General Obligado-Malabrigo','COOPERATIVA AGROPECUARIA DE MALABRIGO LIMITADA COOPERATIVA AGROPECUARIA DE MALABRIGO LIMITADA'),(251,21,61,'30707729739',NULL,NULL,NULL,'COOPERATIVA DE APICULTORES CO PRO A LIMITADA',NULL,'COOPERATIVA DE APICULTORES CO PRO A LIMITADA',1,NULL,'2447',NULL,NULL,NULL,'',NULL,'3492-470018',NULL,'Ruta 34 Km. 168,9','Castellanos-San Vicente','COOPERATIVA DE APICULTORES CO PRO A LIMITADA '),(252,21,173,'30708162104',NULL,NULL,NULL,'COOPERATIVA DE PROVISION APICOLA COSAR LIMITADA',NULL,'COSAR',1,NULL,NULL,NULL,NULL,NULL,'\r\n  En su mayoría, se trata de emprendimientos familiares que complementan el ingreso económico que provee otra actividad.\r\n\r\n El común denominador de todos ellos es la pasión por el trabajo con abejas, una tarea ardua, que requiere paciencia y conocimiento, capacidad de observación, aplicación metódica de procesos y determinación.\r\n...','https://coopcosar.com/','3424951503',NULL,'Ruta 11 Km 455','-Sauce Viejo','COOPERATIVA DE PROVISION APICOLA COSAR LIMITADA COSAR'),(253,21,56,'20242089619',NULL,NULL,NULL,'LEANDRO PICAPIETRA',NULL,'CORRALÓN DON PICA',1,NULL,NULL,NULL,NULL,NULL,'\r\n	Corralón DON PICA inicia sus actividades en el año 2007 como una empresa dedicada principalmente a la venta de postes y artículos rurales.\r\n\r\n	Con el tiempo fuimos ampliando la oferta de productos y anexando varios rubros relacionados, entre ellos, toda una gama de premoldeados de hormigón, tirantería de maderas duras, etc.\r\n\r\n	En el año 2010 comenzamos la comercialización mayorista y minorista de revestimientos naturales para pisos y paredes, de origen nacional e importado.\r\n\r\n	Nuestro objetivo principal es satisfacer las necesidades de cada cliente, brindando atención personalizada y aportando toda nuestra experiencia, y otorgar un abastecimiento rápido del producto ya que contamos con un importante stock.\r\n\r\n	Siguiendo una forma de trabajo y atención heredada de mi padre, Don Víctor Picapietra (Don Pica), continuamos en proceso de expansión y crecimiento, logrando actualmente ser uno de los referentes de la zona.\r\n...',' www.corralondonpica.com.ar  ','03492-15527393',NULL,'Pellegrini 478','Castellanos-Rafaela','Corralón Don Pica CORRALÓN DON PICA'),(254,21,154,'30579828761',NULL,NULL,NULL,'CORRUGADORA CAÑADENSE SOCIEDAD COLECTIVA',NULL,'CORRUCOR',1,NULL,'2506',NULL,NULL,NULL,'\r\n FABRICACIÓN DE CARTÓN ONDULADO Y ENVASES DE CARTÓN\r\n...',NULL,'3471-492200',NULL,'Ruta Nº 9 Km. 362 Nº 1538','Iriondo-Correa','CORRUGADORA CAÑADENSE S.C. CORRUCOR'),(255,21,245,'30502272620',NULL,NULL,NULL,'CORSAL SRL',NULL,'CORSAL S.R.L.',1,NULL,'212406',NULL,NULL,NULL,'\n	En la ciudad de Rosario, provincia de Santa Fe, Argentina, en los comienzos de 1949, se funda CORSAL S.R.L., empresa que se dedicaría a la fabricación de Muelles a Ballestas (elásticos) para el mercado nacional.\n\n	La marca pasa a ser líder en Argentina y reconocida en países vecinos. Sólo quedan detalles para alcanzar la Excelencia, los cuales se cumplimentaron en forma cuidadosa y gradual, hasta que al principio del 2001 CORSAL logra la CERTIFICACIÓN ISO 9001 Y COMERCIALIZACIÓN DE MUELLES A BALLESTAS. Actualmente se sigue abasteciendo a fábricas de remolques, fábricas de maquinarias agrícolas, ferrocarriles y al mercado de repuestos para Camiones, Colectivos, Coches y Pick ups.\n	 \n...','http://corsal.com.ar/','341-4924866',NULL,'BV.SAN DIEGO 1812','Rosario-Villa Gobernador Galvez','CORSAL S.R.L. '),(256,21,119,'30567998130',NULL,NULL,NULL,'CORVEN S A C I F',NULL,'CORVEN',1,NULL,'2600',NULL,NULL,NULL,'\r\n  CORVEN Autopartes forma parte del Grupo Iraola, un grupo de capitales argentinos con espíritu joven, pujante y con la energía necesaria para enfrentar nuevos desafíos de forma permanente como lo exige hoy el mundo de los negocios globales. El Grupo Iraola, con centro en la ciudad de Venado Tuerto, pcia. de Santa Fe, está compuesto por las divisiones de Autopartes, Motos, así como sus divisiones Agropecuaria y Real State.\r\n\r\n  La división de CORVEN Autopartes, desde hace más de 45 años fabrica y comercializa amortiguadores a más de 35 países en el mundo. Hoy en día la empresa ha ampliado su catálogo de productos a otras líneas de producto, que hacen a los sistemas de freno, embrague, transmisión, suspensión y dirección, siempre con el compromiso puesto en la calidad y en el servicio, y nuestros usuarios así lo confirman.\r\n...','www.corven.com.ar','3462-439400',NULL,'ROBERTO IMPERIALE 119','General López-Venado Tuerto','CORVEN S.A.C.I.F. CORVEN'),(257,21,120,'30540450559',NULL,NULL,NULL,'COSTAMAGNA S A',NULL,'WENCO',1,NULL,'2607',NULL,NULL,NULL,'\r\n Distribución y venta de maíz pisingallo, girasol confitero con cascara y pelado.\r\n...','http://www.costamagna.com.ar','3462-450027',NULL,'Av.51 110','General López-Villa cañas','COSTAMAGNA S.A. WENCO'),(258,21,241,'30602173638',NULL,NULL,NULL,'EPTA ARGENTINA S.A.',NULL,'COSTAN',1,NULL,'2000',NULL,NULL,NULL,'\n Costan - Epta Latam líder en la refrigeración comercial también para el mercado Latinoamericano.\n...','http://www.eptalatam.com','341-4615000',NULL,'Ovidio Lagos 6753','Rosario-Rosario','EPTA ARGENTINA S.A. COSTAN'),(259,21,356,'30691020882',NULL,NULL,NULL,'DBT S A',NULL,'CRAMACO',1,NULL,'2440',NULL,NULL,NULL,'\r\n  DBT S.A. es una empresa Argentina que opera la planta industrial CRAMACO®.\r\n\r\n Nuestra larga trayectoria que data desde 1947, donde producimos y reparamos gran variedad de máquinas eléctricas, nos posiciona como una marca líder en el rubro.\r\n\r\n Asumimos un total compromiso con la calidad y la excelencia en la fabricación de los productos Cramaco® y los servicios que brindamos antes, durante y después de una operación de venta. Esta y otras cualidades nos hacen diferentes.\r\n\r\n Tenemos Certificado nuestro Sistema de Gestión de la Calidad y mantenemos un programa de Mejora Contínua fijándonos metas de estricta calidad.\r\n\r\n  Los productos CRAMACO® son un distintivo de calidad y es a través de DBT S.A. que se convierten además, en un símbolo de compromiso con el cliente que requiere que estemos allí cuando nos necesita, resolviendo sus necesidades y asistiéndolo siempre.\r\n...','www.cramaco.com','3406-480007',NULL,'Rivadavia 1701','San Martín-Sastre','D.B.T. S.A. CRAMACO'),(260,21,NULL,'30659231065',NULL,NULL,NULL,'CRIAR S R L',NULL,'CRIAR',1,NULL,'2000',NULL,NULL,NULL,'\n	NUESTRA HISTORIA Criar S.R.L es una empresa constituida en el año 1993. Sus fundadores son personas ligadas a la avicultura por más de 35 años. Al día de hoy la firma cuenta con su propia planta de producción de alimento balanceado y su propia planta de faena. Toda la actividad productiva se desarrolla en una radio no mayor de los 80 kilómetros desde la ciudad de Rosario, y es allí en donde se ubican la oficinas comerciales y administrativas. Los productos se comercializan bajo la marca Carmen del Sauce.\n...','www.criarsrl.com','341-4450181',NULL,'Paraguay 288','Rosario-Rosario Norte','CRIAR S.R.L. CRIAR'),(261,21,200,'30502567299',NULL,NULL,NULL,'CRISTALERIA SAN CARLOS S A',NULL,'CRISTALERIA SAN CARLOS',1,NULL,'301304',NULL,NULL,NULL,'\r\n  El Arte de soplar Cristal | 1949 - 2017\r\n...','www.san-carlos.com.ar','3404-420360',NULL,'SAN MARTIN 1645','Las Colonias-San Carlos Centro','CRISTALERIA SAN CARLOS S.A. CRISTALERIA SAN CARLOS'),(262,21,119,'20061274228',NULL,NULL,NULL,'JOSE EDUARDO CROSSIO',NULL,'CROSSIO',1,NULL,'2600',NULL,NULL,NULL,'\r\n  Es una empresa Fundada por José E. Crossio a comienzos del año 1966, dedicada desde entonces a la fabricación de válvulas y boyas para bebederos de ganado en general. La misma se encuentra ubicada en el Parque Industrial de la ciudad de Venado Tuerto, al sur de la provincia de Santa Fe, en una extensa y pujante región agrícola-ganadera de la República Argentina. Nuestros productos son comercializados en todo nuestro territorio y a su vez exportados a diversos países, teniendo los mismos una muy buena aceptación por lo que respecta a su calidad, funcionamiento y larga v