ctualidad una de las principales fabricantes latinoamericanos con presencia internacional en los cinco (5) continentes y el mayor fabricante de equipos de granallado de Argentina.\r\n...','www.cymmateriales.com.ar','341-4901100',NULL,'Brigadier Estanislao López 6º Piso','Rosario-Soldini','CYM MATERIALES S.A. CYM MATERIALES'),(268,NULL,241,'33501496079',NULL,NULL,NULL,'DANA ARGENTINA S.A.',NULL,'DANA ARGENTINA',0,NULL,'2000',NULL,NULL,NULL,'\r\n En 1904, un estudiante de ingeniería llamado Spicer dejó la Universidad de Cornell para lanzar un nuevo negocio en un rincón libre de una fábrica de New Jersey.\r\n\r\n Mientras aún estudiaba, Spicer patentó el diseño revolucionario de la primera junta universal práctica para transmisión de potencia para automóviles. La innovación de Spicer literalmente liberó a los automóviles de las cadenas: hasta ese momento, la transmisión de la energía se basaba en piñones y cadenas. Pero, en un primer momento, esa iniciativa demostró ser extremamente osada.\r\n\r\n Ingeniero e inventor talentoso, Spicer no tenía ninguna experiencia en fabricación ni en negocios. Y a pesar de que el automóvil estaba destinado a convertirse en una institución mundial, su futuro era bastante incierto a comienzos del siglo XX.\r\n\r\n  Dana Incorporated surgió de ese momento de incertidumbre pa...','www.dana.com.ar','341-4337519',NULL,'Av. Presidente Perón 5601','Rosario-Rosario','DANA ARGENTINA S.A. DANA ARGENTINA'),(269,21,327,'33647348489',NULL,NULL,NULL,'DANES S R L',NULL,'DANES',1,NULL,'213400',NULL,NULL,NULL,'\r\n Desde 1991 DANES es sinónimo de calidad y confiabilidad en el diseño y fabricación de cisternas para el transporte de combustibles, lubricantes, productos químicos y alimenticios y de tolvas -con sistema de descarga mediante aire comprimido- para el transporte de productos pulverulentos y granulares.\r\n\r\n  Las cisternas y tolvas DANES se caracterizan por su resistencia y bajo peso, las más livianas del mercado. Estructuralmente son muy fuertes y de una duración excepcional.\r\n...','www.cisternasdanes.com.ar','341-4960033',NULL,'RUTA A 012 KM 52','San Lorenzo-Roldán','DANES S.R.L. DANES'),(270,21,56,'33674318389',NULL,NULL,NULL,'DAVICINO S A',NULL,'DAVICINO',1,NULL,'230004',NULL,NULL,NULL,'\r\n  Somos una empresa con más de 30 años de experiencia en el mercado, dedicados a la fabricación de columnas de alumbrado, semáforos, torres de iluminación, todos ellos confeccionados con diseños que se adaptan a los diversos espacios públicos de la ciudad según el requerimiento específico de cada cliente.\r\n\r\n  Además nos dedicamos a la provisión de cortes de chapas con plasmas de alta definición, logrando producir piezas de excelente calidad y adaptadas a los pedidos y especificaciones técnicas particulares de cada uno de nuestros clientes.\r\n\r\n También comercializamos materiales para la construcción, tales como caños estructurales, tubos líneas Schedule, caños hidráulicos, ángulos, planchuelas, perfiles, chapas, metal desplegado, mallas metálicas. Dentro de este rubro nos destacamos por brindar servicios de corte y fraccionamiento, como así tambi&eacut...','http://www.davicinosa.com.ar/','3492-503020',NULL,'Av.A.de la Casa (Ruta 34) 542','Castellanos-Rafaela','DAVICINO S.A. DAVICINO'),(271,21,241,'30526133885',NULL,NULL,NULL,'DAVID ROSENTAL E HIJOS S.A.C.I',NULL,'ROSENTAL',1,NULL,'2000',NULL,NULL,NULL,'\r\n	Esta empresa, de origen rosarino, es líder en la distribución y abastecimiento de productos de consumo masivo no perecedero y refrigerado. Es el diagramador, coordinador responsable y operador comercial, logístico y promocional de una cadena de distribución nacional. Rosental es el eslabón de enlace entre la industria y sus 9.000 clientes minoristas del interior. Concentra el poder de compra de todos ellos, brindándoles el beneficio de contar en sus comercios con productos en variedad y calidad, a precios competitivos, con elementos promocionales dirigidos a aumentar ventas, y una entrega eficiente 