sas más importantes del país y el exterior, nos acompañan con su aval, constituyendo parte de nuestros usuarios.\n\n	Nuestros productos: Cargadores de baterías - inversores de tensión - Rectifica...','www.deep-ing.com.ar','341-4552552',NULL,'SALVAT  1344','Rosario-Rosario','DEEP S.R.L. DEEP Ingeniería'),(276,21,347,'30572530996',NULL,NULL,NULL,'DELAVAL S.A',NULL,'DELAVAL',1,NULL,'2535',NULL,NULL,NULL,'\r\n  DeLaval es un proveedor líder de soluciones que ayuda a mejorar el rendimiento de los productores lecheros. Apoyamos a nuestros clientes a reducir su huella ambiental al tiempo que mejora la producción de alimentos, la rentabilidad y el bienestar de las personas y los animales involucrados. Ofrecemos productos, sistemas y servicios para todas las etapas de la producción de leche. Nuestras soluciones son utilizadas por millones de productores lecheros en todo el mundo.\r\n\r\n  DeLaval tiene 4500 empleados y opera en más de 100 mercados. DeLaval, junto con Tetra Pak y Sidel, es parte del grupo Tetra Laval.\r\n...','www.delaval.com','3401-422192',NULL,'ITALIA 772','San Martín-El Trebol','DELAVAL S.A. DELAVAL'),(277,21,56,'30708736879',NULL,NULL,NULL,'DELBA SRL',NULL,'DELBA ',1,NULL,'2300',NULL,NULL,NULL,'\r\n  DELBA SRL es una empresa localizada en la ciudad de Rafaela, en la región centro oeste de la Provincia de Santa Fe. Somos una metalúrgica dedicada a la fabricación de máquinas y equipos para clasificar semillas y legumbres; equipos para elaboración de alimentos balanceados; y máquinas para manejo de fertilizante granulado.\r\n...','www.delbamaquinarias.com.ar','03492-503184',NULL,'S. Valvo 2596','Castellanos-Rafaela','DELBA S.R.L. DELBA '),(278,21,56,'30700337827',NULL,NULL,NULL,'DESARROLLO DE EQUIPOS INDUSTRIALES S A',NULL,'DEISA',1,NULL,'2300',NULL,NULL,NULL,'\r\n Desarrollo de Equipos Industriales S.A. (DEISA) define su actividad en tres unidades de negocio:\r\n\r\n •Plantas y Equipos para el tratamiento y reciclaje de residuos sólidos urbanos.\r\n\r\n  •C