dades de sus clientes, el 9 de enero de 1996 certificó por primera vez en el sistema de aseguramiento de la calidad según las normas ISO 9000 y el 4 de enero de 1999 obtuvo los certificados ASME para recipientes a presión, calderas y piping.\r\n...','www.emu.com.ar','341-4540105',NULL,'Valentín Gomez 4648','Rosario-Rosario','ESTABLECIMIENTO METALURGICO UNIVERSAL EMU'),(342,21,123,'30501653485',NULL,NULL,NULL,'ESTABLECIMIENTO MODELO LAS COLONIAS S A',NULL,'LAS COLONIAS',1,NULL,'3561',NULL,NULL,NULL,'\r\n Ubicada en Avellaneda, norte de la provincia de Santa Fe, Las Colonias comenzó a fabricar galletitas de todos los tipos en Octubre de 1946 para abastecer el creciente mercado del Noreste Argentino motorizado por el cultivo de algodón.\r\n  En 1949 es designada por el Gobierno Nacional para proveer de Pan Dulce a todo el Noreste Argentino en el marco del Programa de Ayuda Social, desde Rafaela hasta Clorinda y desde Santiago del Estero hasta Iguazú. Esta práctica del Gobierno duro hasta 1954 e instaló una tradición nueva: \"El Pan Dulce y la Sidra para las Fiestas\" y en el Noreste Argentino el Pan Dulce Las Colonias.\r\n  Las Colonias S.A es el principal productor y marca líder de pan dulce y budines del Noreste Argentino, elaborando una variada línea de pan dulces y budines bajo las mas estrictas normas de calidad tanto en materias primas como en el proceso, dando como resultado productos confiables para su consumo diferido.\r\n Su capacidad de...','www.emlascolonias.com.ar','3482-481540',NULL,'CALLE 9 N 743','General Obligado-Avellaneda','ESTABLECIMIENTO MODELO LAS COLONIAS S.A. LAS COLONIAS'),(343,21,241,'30519949616',NULL,NULL,NULL,'ESTABLECIMIENTO NUNES SRL',NULL,'NUNES',1,NULL,'2000',NULL,NULL,NULL,'\r\n Máquinas herramienta para corte y deformación de chapa y arranque de viruta.\r\n...','www.nunes.com.ar','341-4644613 / 4622981 / 4633781',NULL,'Rodriguez 4351','Rosario-Rosario','ESTABLECIMIENTO NUNES S.R.L. NUNES'),(344,21,NULL,'30598765193',NULL,NULL,NULL,'ESTABLECIMIENTO SANTA ANA SA',NULL,'CBSÉ',1,NULL,'1875',NULL,NULL,NULL,'\r\n CBSé es una empresa nacional fundada en el año 1978 en la localidad de San Francisco Córdoba. Desde sus inicios innovó en el mercado de la yerba mate común, con la primera yerba con hierbas: Hierbas Serranas. A lo largo de los años y tras la observación de las costumbres de los consumidores, ha lanzado las primeras yerbas saborizadas y funcionales al mercado.\r\n  Las materias primas son seleccionadas en su lugar de origen para envasarlas en su planta de Frontera, Santa Fé. Con más de 15 variedades los productos se comercializan en todo el territorio nacional y el resto del mundo.\r\n...','http://www.cbse.com.ar/','0800-999-2273',NULL,'AV. MITRE 5407','-WILDE','ESTABLECIMIENTO SANTA ANA SA CBSÉ'),(345,21,328,'30607668279',NULL,NULL,NULL,'ESTABLECIMIENTOS CHIAZA S A',NULL,'ESTABLECIMIENTOS CHIAZA',1,NULL,'2154',NULL,NULL,NULL,'\r\n Distribuidor de acero en Capitán Bermúdez\r\n...','http://establecimientos-chiaza-sa.negocio.site/','341-4913686',NULL,'LIMA 71','San Lorenzo-Capitán Bermudez','ESTABLECIMIENTOS CHIAZA S.A. ESTABLECIMIENTOS CHIAZA'),(346,21,56,'30500624961',NULL,NULL,NULL,'ESTABLECIMIENTOS METALURGICOS GAYS SOCIEDAD ANONIMA',NULL,'WESKAN',1,NULL,'2300',NULL,NULL,NULL,'\r\n ESTABLECIMIENTOS METALURGICOS GAYS S.A. fue fundada por el italiano y ex aviador de la 1ra guerra mundial Juan Bautista Gays, iniciando su actividad industrial en el año 1948 fabricando guías de válvulas para motores, siendo así la primera fábrica del país en el rubro. Su hijo, el Ing. Mario D. Gays, y su nieto, el Ing. Eduardo M. Gays, le han dado continuidad industrial formando la segunda y tercera generación empresaria. La empresa inicia sus actividades con fundiciones propias, de donde obtenía la materia prima básica para su producción, constituyendo una industria de relevancia para la época y precursora en el sector metalúrgico-autopartista de país.\r\n Durante muchos años dedicó el 100% de su producción a fabricar guías de válvulas para los modelos Ford “A”, año 1928/34 y Ford V8, año 1934/48, versiones que aún hoy se fabrican para exclusivos...','www.weskan.com.ar','3492-434808',NULL,'JOSE INGENIEROS 390','Castellanos-Rafaela','ESTABLECIMIENTOS METALURGICOS GAYS S.I.C.C. WESKAN'),(347,21,173,'30559453095',NULL,NULL,NULL,'ESTABLECIMIENTOS SAN IGNACIO S A',NULL,'SAN IGNACIO',1,NULL,'3017',NULL,NULL,NULL,'\r\n La historia de San Ignacio comienza en el año 1939 en Rosario, Santa Fe, Argentina, cuando Don Ignacio Rodríguez Soto decidió lanzarse a la aventura de la producción láctea.\r\n\r\n Con la firme convicción y la pasión de Don Ignacio, el crecimiento de la empresa fue sostenida a los largo del tiempo.\r\n\r\n Poco a poco los productos se fueron distribuyendo a todo el país, lo que derivó en la necesidad de ampliarse trasladando la planta elaboradora a Sauce Viejo en 1997. Apenas un año más tarde, en agosto de 1998, la empresa adquiere una nueva planta en la ciudad de Hipatia.\r\n\r\n  En 2011 comienza una nueva etapa en nuestra historia, acompañada de inversiones en equipamiento e infraestructura, y de la capacitación de nuestros recursos humanos para poder implementar los más estrictos procesos de elaboración de nuestros productos, manteniendo la calidad y la dedicación personalizada con las que siempre e...','www.sanignacio.com.ar','+54 342 4590900',NULL,'RUTA 11 KM 447','SANTA FE-SAUCE VIEJO','ESTABLECIMIENTOS SAN IGNACIO S.A. SAN IGNACIO'),(348,21,56,'30710856040',NULL,NULL,NULL,'ESTUDIO ADUANERO RAMOS S.A.',NULL,'ESTUDIO ADUANERO RAMOS',1,NULL,'2300',NULL,NULL,NULL,'\r\n	Estudio Aduanero Ramos S.A., un estudio aduanero dedicado a brindar un servicio integral en Comercio Internacional. Con trayectoria, experiencia, responsabilidad, líder en soluciones ágiles, optimización de recurso y desarrollos adaptables a la evolución comercial.\r\n...','http://www.earsa.com.ar','03492-502222',NULL,'Falucho 226','Castellanos-Rafaela','Estudio Aduanero Ramos S.A. ESTUDIO ADUAN