acional.\r\n\r\n	Legumbres y Cereales: nos especializamos en la producción, procesamiento, logística y comercialización de Poroto Alubia, Poroto Negro, Poroto Colorado, Poroto Pinto, Maíz Pisingallo, etc.\r\n\r\n	Nuestra estructura flexible y alta especialización nos han permitido alcanzar una posición de liderazgo indiscutida en la exportación ...','http://www.cremer.com.ar/es/',NULL,NULL,'Avda San Martin 1762','-Arroyo Seco','Latin Bio S. A. '),(577,21,62,'30709180335',NULL,NULL,NULL,'LATTINA SRL',NULL,'LATINA INDUSTRIAL',1,NULL,'232202',NULL,NULL,NULL,'\r\n Latina Industrial es una empresa metalúrgica dedicada, desde 1991, a la producción de silenciadores originales y deportivos para el mercado automotor y de la motocicleta. La calidad de sus productos generó el reconocimiento de sus clientes y le otorgó prestigio a nivel nacional.\r\n Esta calidad se encuentra fundada en el bajo porcentaje de falla. La empresa dedica especial atención a dos factores relacionados con la tendencia al “cero defecto”: por un lado, cumple con una minuciosa tarea de desarrollo y evaluación de los proveedores y sus productos, es decir, de la materia prima; y, por otro, pone especial énfasis en la capacitación y concientización de su personal.\r\n  La entrega de los artículos con rigurosa puntualidad, que se compromete constantemente a mantener y mejorar, completa un circuito de producción que tiene una notable aceptación de los clientes.\r\n  Tanto las marcas Deportsilen, Ritmo, Evolution,...','http://www.latinaindustrial.com.ar','54-3406-441032',NULL,'Bv. 25 de Mayo 709','Castellanos-Sunchales','LATINA S.R.L. LATINA INDUSTRIAL'),(578,21,241,'33701470589',NULL,NULL,NULL,'LAUGE EQUIPAMIENTOS SRL',NULL,'LAUGE',1,NULL,'2000',NULL,NULL,NULL,'\r\n  Lauge srl es una empresa rosarina cuya principal tarea es ofrecer productos de equipamiento comercial de excelente calidad.\r\n Entre nuestros principales productos puede encontrar exhibidoras verticales y horizontales. Trabajamos la línea Pandy,