ización de una artesanía.\r\n Desde 1957 ubicados en la ciudad de Rosario, provincia de Santa Fe, comenzando con la confección de bolsas y delantales de PVC recorrimos progresivamente diferentes facetas de la fabricación hasta insertarnos en la industria marroquinera específicamente.\r\n Hasta el año 1995 nuestra principal actividad era la fabricación de carteras y bolsos de mujer, punto en el cual diversificamos nuestro universo incorporando l&iacut...','http://www.carteraslore.com','341-4357496',NULL,'Crespo 1836','Rosario-Rosario','LO RE RICARDO, SUCESION DE RICARDO LO RE'),(590,NULL,119,'30707952675',NULL,NULL,NULL,'LONASOL S.A.',NULL,'LONASOL',0,NULL,'2600',NULL,NULL,NULL,'\r\n	LONASOL S.A. es una empresa familiar fundada en el año 1984. En su larga trayectoria esta empresa ha podido convertirse no sólo en líder dentro del rubro de lonas, toldos, cortinas, cerramientos, entre otros; sino que hoy es un referente en la ciudad y en la región. Asumiendo siempre el compromiso con la calidad, LONASOL S.A. cuenta con un taller exclusivo ubicado en la ciudad de Venado Tuerto donde un grupo de profesionales, altamente capacitados, confeccionan a medida los mejores productos.\r\n...','http://www.lonasol.com.ar/','3462-422539',NULL,'R. Nac. Nº 8 y Dante Alighieri','General López-Venado Tuerto','LONASOL S.A. LONASOL'),(591,21,151,'30503894072',NULL,NULL,NULL,'LOPEZ HNOS S R L',NULL,'LOYTO',1,NULL,'2500',NULL,NULL,NULL,'\r\n  Esta firma surgió a la actividad fabril por la decisión de un grupo de hermanos, todos nacidos en nuestra Argentina.\r\n\r\n Se lanzaron a la actividad industrial por el espíritu estudioso de uno de los fundadores, Esteban que era técnico electrónico, sus conocimiento le permitieron crear un elemento de suma utilidad para el campo: \"El electrificador de alambrados automático\" que funcionaba únicamente cuando el animal tocaba el alambrado.\r\n\r\n En el momento de buscar una marca para sus productos pensaron en hacer un homenaje a sus progenitores: LO