te las necesidades del productor agropecuario.\r\n\r\n	Desde sus inicios, CELE se fue afianzando en el mercado con la fabricación de implementos agrícolas de roturación (Rastras de Doble Acción, Arados de Rejas y de Cinceles, Equipos Cama de Siembra, etc.).\r\n\r\n	Más tarde, la marca se inclinó al diseño sembradoras tanto de granos finos como de granos gruesos.\r\n\r\n	La empresa, cuenta hoy con una planta fabril de 2.500 m2 y ha incorporado un lote de 20.000 m2 en el predio del Área Industrial Armstrong.\r\n\r\n	Su titular es Aldo Leguizamón, siendo el gerente de la empresa Hugo Leguizamón.\r\n...','www.celesrl.com.ar','3471-461452',NULL,'Calle Pública 1656','Belgrano-Armstrong','METALURGICA CELE S.R.L. CELE'),(643,21,5,'30601942352',NULL,NULL,NULL,'METALURGICA CINAL FOR S R L',NULL,'CINAL-FOR',1,NULL,'250503',NULL,NULL,NULL,'\r\n  Fundada en el año 1974 por su actual Socio-Gerente, inicia sus actividades con la fabricación de bombas y comederos para hacienda.\r\n\r\n Hacia el año 1984 inclina su producción hacia la fabricación de pulverizadores de arrastre y en 1987 incorpora los autopropulsados. Continuando con la innovación tecnológica en el 2004 lanza al mercado el atomizador frutihortícola el cuál le permite ofrecer a sus clientes la línea completa de pulverizadores. La misma va en equipos de arrastre desde los 200 litros de capacidad hasta los 3700 y en equipos autopropulsados desde los 2500 a los 3400.- Además, contamos con equipos para cultivo de granos y otros desarrollados específicamente para papa y tabaco como así también con máquinas para silos y atomizadores para árboles frutales.\r\n...',NULL,'3471-471393',NULL,'AREA INDUSTRIAL','Berlgrano-Las Parejas','METALURGICA CINAL FOR S.R.L. CINAL-FOR'),(644,21,139,'30500794506',NULL,NULL,NULL,'METALURGICA GENOVESE S.A',NULL,'GENOVESE',1,NULL,'3560',NULL,NULL,NULL,'\r\n  Nuestra labor se enmarca en el rubro de la agroindustria; los esfuerzos se aunan para consolidar una trayectoria jalonada de diversos desafí