ras metálicas para galpones, etc. Y definitivamente en 1980 se comienza con la fabricación de implementos agrícolas; Tanques para combustible, arado de cincel, rastras rotativas y lo que hoy compone nuestra variada línea de implementos; rastras de discos desencontrados, carros forrajeros, chimangos, cintas transportadoras, inoculadoras, embutidoras, cargadores de silos y una completa línea de Mixer. Actualmente se trabaja en tres plantas separadas con una superficie cubierta de aproximadamente 2300mts² y se está construyendo una nueva planta de 4550 mts sobre un terreno se 19200 mts en el área industr...','www.micellisa.com.ar','+54-3471-461376',NULL,'Flotron 1457','Belgrano-Armstrong','METALURGICA MICELLI S.A. MICELLI'),(648,21,241,'30708895594',NULL,NULL,NULL,'METALURGICA NORTE S.R.L.',NULL,'METANOR',1,NULL,'2000',NULL,NULL,NULL,'\r\n  Más de 15 años de permanencia y desarrollo en el mercado automotor posicionan a METANOR entre los líderes en la fabricación de autopartes, contando con una línea completa de soportes de cardan.\r\n  Actualmente, nos hemos focalizado en ampliar nuestra gama de productos con la línea de rodamientos de embrague, tanto para vehículos livianos como pesados.\r\n Nuestra empresa crece día a día, fortaleciéndose, los departamentos propios de Ingeniería y Desarrollo, de Metrología y de Matricería, junto a las modernas maquinarias (prensas de vulcanizado, torno CNC; entre otras) nos permiten afianzarnos para despegar con una base sólida que redunde en mejores productos y servicios.\r\n  Además, el impulso ganado en el mercado interno nos permite prepararnos para exportar, disponiendo de los estándares necesarios para incursionar en mercados externos a corto plazo.\r\n...','http://www.metalurgicanortesrl.com.ar/','341-4309353',NULL,'REPUBLICA DOMINICANA 482 BIS','Rosario-Rosario','METALURGICA NORTE S.R.L. METANOR'),(649,21,241,'30502222674',NULL,NULL,NULL,'METALURGICA PICOTTO S.H DE EDGARDO PEDRO PICOTTO Y OSVALDO HUGO PICOTTO',NULL,'METALURGI