tidamente en nuestros productos.\r\n\r\n	Nuestra disponibilidad a nuevos proyectos nos ha enriquecido de manera que estamos preparados para darle soluciones fiables a múltiples necesidades productivas.\r\n...',NULL,'3404-420040',NULL,'Sarmiento 1384','Las Colonias-San Carlos Centro','METALURGICA SAN CARLOS S.A. METALURGICA SAN CARLOS'),(653,21,56,'30714610291',NULL,NULL,NULL,'METALURGICA SAPINO S.A.',NULL,'METALURGICA SAPINO',1,NULL,'2300',NULL,NULL,NULL,'\r\n	SAPINO, es una empresa metal mecánica orientada a la fabricación de piezas para la extracción y conducción de agua. Comercializando productos tales como cilindros de bronce para extracción de agua, cierres automáticos para molinos y válvulas de cierre para bebedores.\r\n...','http://www.metalurgicasapino.com.ar','3492-423959',NULL,'Carlos Nicola 53','Castellanos-Rafaela','METALURGICA SAPINO de Roberto Sapino METALURGICA SAPINO'),(654,21,180,'30687011941',NULL,NULL,NULL,'METALURGICA SARMIENTO S R L',NULL,'METALURGICA SARMIENTO',1,NULL,'3080',NULL,NULL,NULL,'\r\n  METALÚRGICA SARMIENTO S.R.L es una organización industrial dedicada al diseño, fabricación y montaje de equipos metalúrgicos de diverso tipo.\r\n  Contamos con tres grandes divisiones industriales, donde ingeniería, valor agregado y mejora de la productividad de nuestros clientes son compromisos asumidos en cada trabajo:\r\n\r\n División Equipos Especiales para la Mejora de Procesos Industriales.\r\n División Equipos para la Aspiración y Filtrado de Polvos y Gases.\r\n División Tanques de Acero Inoxidable y Acero al Carbono.\r\n Nuestro foco está puesto en escuchar las necesidades de nuestros clientes, diseñar una potencial solución, fabricarla y montarla. Abarcamos todo el proceso o una parte del mismo.\r\n\r\n  Abarcamos sectores industriales tan diversos como Alimenticio, Maderero, Cuero, Metalúrgico, Fundición, Químico, Vitivinícola, etc.\r\n\r\n  Cada proyecto es un nuevo desafío de entregar ...',NULL,'3496-421571',NULL,'SOLER 1165','Las Colonias-Esperanza','METALURGICA SARMIENTO S.R.L. METALURGICA SARMIENTO'),(655,21,56,'30707060251',NULL,NULL,NULL,'METALURGICA STERK S.A.',NULL,'STERK',1,NULL,'2300',NULL,NULL,NULL,'\r\n	METALÚRGICA STERK S.A. y VAN DER SPOEL SEGURIDAD, son empresas líderes en la fabricación de cajas fuertes, bóvedas y muebles de seguridad, con más de 40 años de experiencia en el mercado.\r\n\r\n	En nuestro catálogo de productos encontrará una línea de cajas fuertes de alta seguridad, armeros, buzones recaudadores, armarios ignífugos para documentos en papel y para soportes magnéticos, cajas hoteleras, tesoros para empotrar, tesoros para amurar, puertas de bóvedas, bóvedas bancarias y otros productos para brindarle seguridad y tranquilidad.\r\n\r\n	Desde la ciudad de Rafaela, en el centro de la Argentina, ofrecemos al mercado más de 100 productos, servicio post- venta en todo el territorio nacional, estudios de seguridad, pericias post-delito y cerrajería bancaria. Porque creemos en lo que hacemos y confiamos plenamente en la calidad de nuestros productos.\r\n...','http://www.cajas-fuertes-sterk.com/','3492-451330',NULL,'San Lorenzo 1043','Castellanos-Rafaela','METALURGICA STERK S.A. STERK'),(656,21,6,'30709507008',NULL,NULL,NULL,'MEYPLA PLASTICOS S.A',NULL,'MEYPLA',1,NULL,'2520',NULL,NULL,NULL,'\r\n  Una evolución permanente, acorde a los tiempos que corren y a los, cada vez, más exigentes requerimientos.\r\n\r\n Somos una empresa de tipo familiar fundada en 1967 por Juan José Miño como taller de reparaciones y moldeo de plásticos termofijos.\r\n\r\n En el año 1978 se traslada la fábrica donde se encuentra hasta nuestros días funcionando las 24 horas, dedicada el 90% de su estructura al sector agrícola proveyendo repuestos plásticos.\r\n\r\n  Desde la idea original hasta su realización como producto, lo acompañamos con más de 40 años de constante evolución y mejora continua en desarrollo de partes y componentes plásticos.\r\n...','http://www.meypla.com',' 03471-451261',NULL,'MAIPU  80','Berlgrano-Las Rosas','MEYPLA PLASTICOS SA MEYPLA'),(657,21,241,'30712013962',NULL,NULL,NULL,'WORMS ARGENTINA S.A',NULL,'WORMS ARGENTINA',1,NULL,'2000',NULL,NULL,NULL,'\r\n	Worms Argentina SA es una empresa de capitales nacionales, que brinda a sus clientes un servicio diferenciado, dedicado a tareas específicas de saneamiento ambiental, cuyo objetivo tiende a contribuir al desarrollo del equilibrio entre la sociedad, las empresas y el medio ambiente.\r\n	Desde hace más de 20 años es pionera en la aplicación de biotecnología sencilla a un problema de alcance masivo: la contaminación.\r\n\r\n	Constantemente nos encontramos investigando y aportando soluciones viables y sustentables, a temas complejos como los residuos sólidos urbanos, los residuos líquidos y sólidos orgánicos no peligrosos, y la contaminación de neumáticos fuera de uso; ya que hoy, el medio ambiente a nivel global, se ve amenazado por estos desechos.\r\n	Worms es el camino a la Con Ciencia Natural.\r\n...','https://wormsargentina.com/','+54 (341) 4490060 ',NULL,'Eva Perón 6576','Rosario-Rosario','MIL VAL S.R.L.  WORMS ARGENTINA'),(658,21,182,'30682032630',NULL,NULL,NULL,'MILKAUT SA',NULL,'MILKAUT S.A.',1,NULL,'3009',NULL,NULL,NULL,'','www.milkaut.com.ar','+54 342 450 1269',NULL,'RIVADAVIA 1984','Las Colonias-Franck','MILKAUT S.A. '),(659,21,241,'20060697052',NULL,NULL,NULL,'FEDERICO ALBERTO MIRAVETE',NULL,'OLLAS DOÑA TINA',1,NULL,'2000',NULL,NULL,NULL,'\r\n  Iniciada en 1973 por Federico Alberto Miravete, en Rosario, Argentina, como una pequeña fundición en tierra, llegando a la actualidad transformada en una empresa familiar de la industria metalúrgica de fundición de aluminio en matrices, diseñando, fabricando y comercializando nuestros productos.\r\n La experiencia nos permite ofrecer DOÑA TINA, una bateria de cocina que se adapta a las normas y exigencias de los mercados más desarrollados, utilizando materiales de óptima calidad, equilibrados con precio, diseño y utilidad.\r\n...','https://www.facebook.com/Ollas-Do%C3%B1a-Tina-304361626295262/','0341-5454318',NULL,'AV.MANUEL ARIJON 1734','Rosario-Rosario','MIRAVETE FEDERICO ALBERTO OLLAS DOÑA TINA'),(660,21,241,'30585194448',NULL,NULL,NULL,'MODEPLAST SOCIEDAD ANONIMA',NULL,'MODEPLAST',1,NULL,'2000',NULL,NULL,NULL,'\r\n  MODEPLAST S.R.L. es el producto del resultado obtenido a través de una larga e importante trayectoria industrial que tuvo sus inicias en el año l978, mediante las gestiones que desarrollaron sus fundadores.\r\n  Nos referimos en este caso a Maria Antonia Martínez, Dra. Esther I. Jiménez y Eduardo Andrés Mosconi, Técnica Industrial, quienes entonces se asociaron para dar lugar al nacimiento y crecimiento del actual emprendimiento productivo que la firma lleva a cabo y en la actualidad, con marcado éxito.\r\n En 1978 se produce el lanzamiento fabril ubicado en su actual dirección de calle Zeballos No. 3323, de la ciudad de Rosario, provincia de Santa Fe, República Argentina. Para el desarrollo de la citada actividad la sociedad adquiere la primera máquina marca Schwartz, destinada a la fabricación de botones.\r\n En l979 la sociedad decide diversificar sus actividades anexando nuevos artículos a su producción y paulatin...','www.modeplast.com','341-4397324',NULL,'ZEBALLOS 3323','Rosario-Rosario','MODEPLAST S.R.L. MODEPLAST'),(661,21,56,'30500768262',NULL,NULL,NULL,'MOLFINO HNOS SOCIEDAD ANONIMA',NULL,'SAPUTO',1,NULL,'2300',NULL,NULL,NULL,'\r\n  Molfino Hermanos es una subsidiaria de Saputo Inc. Que opera dos plantas en el corazón de la República Argentina. Desde Rafaela, en la provincia de Santa Fe y Tío Pujio, en la provincia de Córdoba. Molfino Hermanos produce diferentes variedades de quesos y productos lácteos e ingredientes. Saputo Inc adquirió Molfino en el año 2003 y a partir de ese momento la empresa no ha dejado de crecer.\r\n\r\n  Se comercializan bajo las marcas de La Paulina, Ricrem, Senda, Taluhet, SAPUTO y STELLA\r\n...','www.saputo.com','3492-44080',NULL,'VALENTIN VIRASORO 2656 1','Castellanos-Rafaela','MOLFINO HNOS. S.A. SAPUTO'),(662,21,13,'30707016422',NULL,NULL,NULL,'MOLIENDAS CASEROS S R L',NULL,'MOLIENDAS CASEROS',1,NULL,'2170',NULL,NULL,NULL,'','www.moliendascaseros.com.ar','3464420757',NULL,'BV.ARGENTINO 921','Caseros-Casilda','MOLIENDAS CASEROS S.R.L. MOLIENDAS CASEROS'),(663,21,14,'30597264565',NULL,NULL,NULL,'MOLINO CHABAS S A',NULL,'MOLINO CHABAS ',1,NULL,'2173',NULL,NULL,NULL,'\r\n  Molino Chabás S.A. está emplazada en la localidad de Chabás, provincia de Santa Fe, en el Centro-Este de la República Argentina. Es la zona de la Pampa fértil, cuya actividad principal, desde el asentamiento de los primeros pobladores allá por 1882 fue el cultivo de cereales y oleaginosas.\r\n...','http://molinochabas.com.ar','03464-480122',NULL,'Ruta Nacional 33 Km. 715','Caseros-Chabas','MOLINO CHABAS S.A. MOLINO CHABAS '),(664,21,191,'30541934029',NULL,NULL,NULL,'MOLINO MATILDE S A',NULL,'MOLINO MATILDE - VITOSAN',1,NULL,'3013',NULL,NULL,NULL,'\r\n  Molino Matilde S.A. exporta desde el año 2001 gran parte de la producción y Brasil es el principal mercado. Enviamos a ese país regularmente harinas de trigo de distintos tipos.\r\n  La empresa tiene distribuidores en los estados de San Pablo, Paraná, Matto Grosso, Rondonia, Acre, Pará y Goias.\r\n  El 40 % de la producción se exporta y el resto tiene destino en el mercado interno, donde abastecemos la ciudad de Santa Fe y alrededores y hacia el norte del país.\r\n  Estos mercados fueron desarrollados, y actualmente seguimos en la misma línea, debido a nuestra principal fortaleza en la calidad, definida por la selección de nuestros trigos producidos bajo convenio, la conservación de nuestros trigos sin el uso de insecticidas por lo cual debemos enfriar el cereal y el cuidado minucioso en el proceso de molienda.\r\n...','www.molinomatilde.com.ar','342-4993070',NULL,'BV SAN MARTIN 808','Las Colonias-Matilde','MOLINO MATILDE S.A. MOLINO MATILDE - VITOSAN'),(665,21,51,'30501847050',NULL,NULL,NULL,'MOLINO VICT