en constante crecimiento, incorporando personal y tecnología...','www.grabich.com.ar','3464-470535',NULL,'L. Torre 1311','Caseros-Arequito','PRODUCTOS GRABICH S.R.L. PRODUCTOS GRABICH S.R.L.'),(1048,21,171,'30589527115',NULL,NULL,NULL,'RED SURCOS S.A.',NULL,'RED SURCOS',1,NULL,'3000   ',NULL,NULL,NULL,'\r\n	RED SURCOS es una empresa argentina constituida en su totalidad por capitales nacionales y cuenta con un equipo de más de 250 personas capacitadas para construir día a día los más altos niveles de innovación, desarrollo, producción y comercialización de insumos para el agro.\r\n...','www.redsurcos.com','342-4552366',NULL,'Ruta Nacional Nº 19 Km 2, Av. Freyre 2363 (oficina)','La Capital-Santa Fe','RED SURCOS RED SURCOS'),(1049,NULL,180,'30710262698',NULL,NULL,NULL,'RESSCREEN S.R.L.',NULL,'RESSCREEN S.R.L.',0,NULL,'3080   ',NULL,NULL,NULL,'\r\n	La empresa ResScreen SRL produce un kit de test (ensayos) para la rápida y fácil detección de sustancias contaminantes en la leche. Este kit es una alternativa de bajo costo que permite a los productores realizar análisis en el mismo tambo, controlando de forma simple y segura la calidad del producto que entrega a sus clientes. Del mismo modo, este producto es utilizado por las empresas lácteas en planta.\r\n	El método se basa en la inhibición del crecimiento de bacterias debido a la presencia de agentes antimicrobianos en la leche. El test ha sido optimizado fundamentalmente para la detección precisa de antibióticos betalactámicos, tetraciclinas y sulfamidas en la leche.\r\n	ResScreen S.R.L también asesora tanto a productores como a empresarios e industriales en aquellos aspectos relacionados con la calidad de sus productos, inocuidad de los alimentos, rendimiento y eficiencia de los procesos productivos.\r\n...',NULL,'3496-421640',NULL,'Sarmiento 1261','Las Colonias-Esperanza','RESSCREEN S.R.L. RESSCREEN S.R.L.'),(1050,21,241,'20170003889',NULL,NULL,NULL,'JUAN BENILDE VEGA',NULL,'SANAT SABORES NATURALES',1,NULL,'2000   ',N