icular de trabajo, en donde la empresa trabaja y comercializa en forma Just in Time, incrementando paulatinamente producción, ventas y reinvirtiendo en forma constante en crecimiento tanto en superficie como en maquinarias y herramientas.\r\n\r\n La materia prima de los productos Vidalac...','www.vidalac.com','0342-4547908',NULL,'CALLE 6 Y COLECTORA NORTE','LA CAPITAL-SAUCE VIEJO','ALIMENTOS VIDA S.A. VIDALAC'),(1117,21,329,'30536928703',NULL,NULL,NULL,'MOLINOS JUAN SEMINO SA',NULL,'SEMINO',1,NULL,'2138',NULL,NULL,NULL,'\r\n Compañía netamente familiar fundada en 1865, Molinos Juan Semino S.A., se presenta como una de las pocas sociedades de capitales netamente argentinos permaneciendo en manos de una familia durante seis generaciones. Único productor de Almidón y Gluten de Trigo en América Latina. También produce Harina de Trigo con más de 150 años de experiencia, orientado a la fabricación de productos especiales privilegiando calidad con una constante tecnificación de sus procesos industriales.\r\n\r\n  \r\n  The company mainly familial founded in 1865, Molinos Juan Semino SA, is introduced as one of the few companies purely Argentine capital remained in the hands of one family for six generations. The only producer of Wheat Starch and Vital Wheat Gluten in Latin America, also produce Wheat Flour, with over 150 years of experience, focused on the production of special quality products prioritizing a constant modernization of its industrial processes.\r\n\r\n  \r...','www.ffingredients.com.ar','+54 3329 439720',NULL,'Bv Americano sin Numero','San Lorenzo-Carcaraña','Molinos Juan Semino SA SEMINO'),(1118,21,56,'20161700860',NULL,NULL,NULL,'DIEGO JOSE TURCO',NULL,'JIT LUBRICACION',1,NULL,'2300 ',NULL,NULL,NULL,'\r\n  JIT LUBRICACION es una empresa de 60 años de trayectoria, una década certificada con ISO 9000, dedicada al diseño, fabricación y venta de herramientas de lubricación para mantenimiento de equipos, con fuerte presencia en Latinoamérica y alta capacidad d